import React, { FC, memo } from 'react';
import AEMLogo from '../images/skills/aem-logo.png';

const Skills: FC = () => {
  return (
    <div className='skills'>
      <h2>Skills</h2>
      <img src={AEMLogo} alt='Adobe Experience Manager' />
    </div>
  );
};
export default memo(Skills);
